import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div className="main">
            <div className="mainDiv">

                <h1>72 Hour Challenge</h1>
                <h2>Develop Branch</h2>
                <h3>Allison's Branch</h3>

            </div>
        </div>
    );
}

export default Home;
